import React from 'react';

import './App.css';

class App extends React.Component{
  render(){
    var name="张三"
    var content="<span style='color:red'>hongse </span>"
    return(
    <div className="App" dangerouslySetInnerHTML={{__html:content}}>hello world </div>
    )
  }
}

export default App;
